import Achivement from "../Achivement/Achivement";
import "./Experience.css";
const Experience = () => {
  return (
    <section className="experience">
      <div>
        <Achivement content={`+8`} />
        <div>
          <span>years</span>
          <span>Experience</span>
        </div>
      </div>
      <div>
        <Achivement content={`+20`} />
      </div>
      <div>
        <Achivement content={`+8`} />
      </div>
    </section>
  );
};

export default Experience;
